// www.hightopo.com - ht for web
(function(){
    
    ht.Default.setImage('frame-back', 128, 256, 'data:image/png;base64,');
    ht.Default.setImage('frame-front', 128, 256, 'data:image/png;base64,');

    //ht.Default.setImage('frame-front', 'window.png');

    ht.Default.setImage('wall1', 32, 32, 'data:image/jpeg;base64,');
    ht.Default.setImage('wall2', 32, 32, 'data:image/jpeg;base64,');
    ht.Default.setImage('wall3', 32, 32, 'data:image/jpeg;base64,');

    ht.Default.setImage('door1', 32, 32, 'data:image/jpeg;base64,');
    ht.Default.setImage('door2', 32, 32, 'data:image/jpeg;base64,');
    ht.Default.setImage('door3', 32, 32, 'data:image/jpeg;base64,');


    var connectorColor = '#E5C068',
        labelColor = 'white',
        labelBackground = '#3498DB',
        frameColor = '#3A3B3B',
        distributionFrameColor = '#D7C8B3',
        styles = {
            'distribution.frame.color': distributionFrameColor,

            'odf.port.color': '#D7C8B3',
            'odf.port.center.color': '#3498DB',
            'odf.port.center.visible': true,
            'odf.port.border.color': '#3498DB',
            'odf.port.border.visible': true,

            'ddf.port.color': '#D7C8B3',
            'ddf.port.ring.color': '#3498DB' 
        };
    for(var name in styles){
        ht.Style[name] = styles[name];
    }
      
    // define distribution frame
    ht.Default.setShape3dModel('distribution-frame', { 
            shape3d: ht.Default.createFrameModel(0.1, 0, 0.1, {top: true, bottom: true, back: true}),
            color: { func: 'style@distribution.frame.color' }
        }
    );     
    
    // define ODF Port model
    ht.Default.setShape3dModel('odf-port', [
        {
            shape3d: 'box',                        
            color: { func: 'style@odf.port.color' }            
        },
        {
            shape3d: 'box',
            s3: [0.5, 0.5, 1.1],                        
            visible: { func: 'style@odf.port.center.visible'},
            color: { func: 'style@odf.port.center.color' }
        },
        {
            shape3d: ht.Default.createFrameModel(),
            s3: [1.1, 1.1, 1.1],  
            visible: { func: 'style@odf.port.border.visible'},
            color: { func: 'style@odf.port.border.color' }                       
        }
    ]);                              

    // define DDF Port model
    ht.Default.setShape3dModel('ddf-port', [
        {
            shape3d: ht.Default.createRingModel([
                0.3, 0.5,
                0.5, 0.5,
                0.5, -0.5,
                0.3, -0.5,
                0.3, 0.5
            ]),
            s3: [1, 1.25, 1],
            r3: [Math.PI/2, 0, 0],
            color: { func: 'style@ddf.port.ring.color' }
        },
        {
            shape3d: ht.Default.createBoxModel(),
            color: { func: 'style@ddf.port.color' }
        }
    ]);  
    
    // define door
    ht.Door = function(texture){
        ht.Door.superClass.constructor.call(this);
        this.setPoints(new ht.List([
            {x: -60, y: 0},
            {x: 60, y: 0}
        ]));
        this.setThickness(20);
        this.setTall(300);
        this.setElevation(150);
        this.s({
            'shape.background': null,
            'shape.border.width': 10,
            'all.image': texture || 'door1',
            'all.reverse.cull': true
        });          
    };
    ht.Default.def('ht.Door', ht.Shape, {    
        onPropertyChanged: function (e) {
            ht.Wall.superClass.onPropertyChanged.call(this, e);
            if (e.property === 'shape' || e.property === 's:all.image') {
                var image = ht.Default.getImage(this.s('all.image'));
                if(image){
                    var x = Math.ceil(this.getLength() / image.width / 4),
                        y = Math.ceil(this.getTall() / image.height / 4);
                    this.s({
                        'all.uv.scale': [x, y]
                    });
                }   
            }
        }                
    });    
    
    // define wall
    ht.Wall = function(texture){
        ht.Wall.superClass.constructor.call(this);
        this.setPoints(new ht.List([
            {x: -1500, y: -1500},
            {x: 1500, y: -1500},
            {x: 1500, y: 1500},
            {x: -1500, y: 1500},
            {x: -1500, y: -1500}
        ]));
        this.setThickness(10);
        this.setTall(400);
        this.setElevation(200);
        this.s({
            'shape.background': null,
            'shape.border.width': 10,
            'all.image': texture || 'wall1',
            'all.reverse.cull': true
        });       
    };
    ht.Default.def('ht.Wall', ht.Shape, {    
        onPropertyChanged: function (e) {
            ht.Wall.superClass.onPropertyChanged.call(this, e);
            if (e.property === 'shape' || e.property === 's:all.image') {
                var image = ht.Default.getImage(this.s('all.image'));
                if(image){
                    var x = Math.ceil(this.getLength() / image.width / 4),
                        y = Math.ceil(this.getTall() / image.height / 4);
                    this.s({
                        'all.uv.scale': [x, y]
                    });
                }   
            }
        }                
    });       
    
    // define frame
    ht.Frame = function(){
        ht.Frame.superClass.constructor.call(this);
        this.s({
            'label.position': 3,
            'label.color': labelColor,
            'label.offset.y': 0,
            'label.background': labelBackground,
            'front.image': 'frame-front',
            'front.transparent': true,
            'back.image': 'frame-back',
            'all.color': frameColor,
            'shape': 'rect',
            'shape.background': frameColor
        });
        this.s3(100, 240, 100);
        this.p3(0, 120, 0);        
    };
    ht.Default.def('ht.Frame', ht.Node, {        
    });     
    
    
    // define distribution frame
    ht.DistributionFrame = function(){
        this.s({
            'shape3d': 'distribution-frame',
            'label.position': 3,
            'label.color': labelColor,
            'label.offset.y': 0,
            'label.background': labelBackground,
            'shape': 'rect',
            'shape.background': distributionFrameColor
        });
        this.s3(140, 340, 120);
        this.p3(0, 170, 0);        
    };
    ht.Default.def('ht.DistributionFrame', ht.Node, {        
    });    
    
    // define ODFPort class
    ht.ODFPort = function(){
        ht.ODFPort.superClass.constructor.call(this);
        this.s({
            'shape3d': 'odf-port',
            'shape': 'rect'
        });
        this.s3(7, 4, 12);  
    };
    ht.Default.def('ht.ODFPort', ht.Node, {        
    });
    
    // define DDFPort class
    ht.DDFPort = function(){
        ht.DDFPort.superClass.constructor.call(this);
        this.s({
            'shape3d': 'ddf-port',
            'shape': 'rect'
        });
        this.s3(7, 4, 12);  
    };
    var PORT_PROPERTIES = {
        'position': 1,
        'elevation': 1,
        'height': 1
    };
    ht.Default.def('ht.DDFPort', ht.Node, { 
        _setConnector: function(connector){
            this._connector = connector;
        },
        getConnector: function(){
            return this._connector;
        },
        onPropertyChanged: function (e) {
            ht.DDFPort.superClass.onPropertyChanged.call(this, e);
            if (this._connector && PORT_PROPERTIES[e.property]) {
                this._connector.adjustConnector();
            }
        }                
    });
    
    // define DDFPort connector class
    ht.DDFConnector = function(){
        ht.DDFConnector.superClass.constructor.call(this);        
        this.setThickness(2);
        this.setTall(2);
        this.setPoints([
            {x:-3, y:-9},
            {x:-3, y:9},
            {x:3, y:9},
            {x:3, y:-9}
        ]); 
        this.s({
            'shape.background': null,
            'shape.border.width': 3, 
            'shape.border.color': connectorColor,  
            'shape3d': 'cylinder',
            'shape3d.color': connectorColor,
            'shape3d.top.visible': false,
            'shape3d.bottom.visible': false
        });      
    };
    ht.Default.def('ht.DDFConnector', ht.Shape, {   
        getPort1: function(){
            return this._port1;
        },
        setPort1: function(value){
            var oldValue = this._port1;
            if(oldValue === value){
                return;
            }
            this._port1 = value;
            if(oldValue){
                oldValue._setConnector(null);
            }
            if(value){
                value._setConnector(this);
            }
            this.fp('port1', oldValue, value);
            this.adjustConnector();
        },
        getPort2: function(){
            return this._port2;
        },
        setPort2: function(value){
            var oldValue = this._port2;
            if(oldValue === value){
                return;
            }
            this._port2 = value;
            if(oldValue){
                oldValue._setConnector(null);
            }
            if(value){
                value._setConnector(this);
            }
            this.fp('port2', oldValue, value);
            this.adjustConnector();
        }, 
        adjustConnector: function(){
            if(ht.Default.isIsolating()){
                return;
            }
            var port1 = this._port1,
                port2 = this._port2;
            if(port1 && port2){
                var p13 = port1.p3(),
                    p23 = port2.p3(),
                    x1 = p13[0],
                    y1 = p13[1],
                    z1 = p13[2],
                    x2 = p23[0],
                    y2 = p23[1],
                    deep = port1.getHeight() * 1.6,
                    dx = Math.abs(x2 - x1),
                    dy = Math.abs(y2 - y1);                            
                if(dx > dy){
                    this.setRotationZ(0);
                    this.setPoints([
                        {x:x1, y:z1-deep/2},
                        {x:x1, y:z1+deep/2},
                        {x:x2, y:z1+deep/2},
                        {x:x2, y:z1-deep/2}
                    ]);
                    this.setElevation(y1);
                }else{
                    this.setRotationZ(Math.PI/2);
                    this.setPoints([
                        {x:-dy/2, y:-deep/2},
                        {x:-dy/2, y:deep/2},
                        {x:dy/2, y:deep/2},
                        {x:dy/2, y:-deep/2}
                    ]);                   
                    this.p3(x1, (y1+y2)/2, z1);
                }            
            }
        },        
        getSerializableProperties: function(){
            var map = ht.DDFConnector.superClass.getSerializableProperties.call(this);        
            map.port1 = 1;              
            map.port2 = 1;              
            return map;
        }                  
    });
    
})();

